import React, { useEffect, useState } from 'react';
import {
  Box, Typography, Paper, Grid, Card, CardContent,
  Button, Chip, Divider
} from '@mui/material';
import Sidebar from '../../components/Layout/Sidebar';
import Topbar from '../../components/Layout/Topbar';

const AdministrarSuscripciones = () => {
  const [planes, setPlanes] = useState([]);
  const [planActual, setPlanActual] = useState('');

  useEffect(() => {
    const fetchPlanes = async () => {
      try {
        const token = localStorage.getItem('token');
        const res = await fetch('http://localhost:5000/api/planes', {
          headers: { Authorization: `Bearer ${token}` }
        });
        const data = await res.json();
        setPlanes(data);
        if (data.length > 0) {
          setPlanActual(data[1]?.nombre || data[0].nombre); // Ej. 'Premium'
        }
      } catch (error) {
        console.error('Error al cargar los planes:', error);
      }
    };
    fetchPlanes();
  }, []);

  const cambiarPlan = (direccion) => {
    const indexActual = planes.findIndex((p) => p.nombre === planActual);
    const nuevoIndex = indexActual + direccion;
    if (nuevoIndex >= 0 && nuevoIndex < planes.length) {
      setPlanActual(planes[nuevoIndex].nombre);
    }
  };

  return (
    <Box display="flex">
      <Sidebar />
      <Box flexGrow={1} p={3}>
        <Topbar title="Gestión de Suscripciones" />
        <Paper sx={{ p: 3 }}>
          <Typography variant="h6" gutterBottom>
            Plan Actual: {planActual}
          </Typography>
          <Typography variant="body1" color="text.secondary" gutterBottom>
            Puedes cambiar tu plan de suscripción según tus necesidades y métodos de pago preferidos.
          </Typography>

          <Box display="flex" gap={2} my={2}>
            <Button
              variant="contained"
              color="secondary"
              disabled={planActual === planes[0]?.nombre}
              onClick={() => cambiarPlan(-1)}
            >
              Degradar Plan
            </Button>
            <Button
              variant="contained"
              color="primary"
              disabled={planActual === planes[planes.length - 1]?.nombre}
              onClick={() => cambiarPlan(1)}
            >
              Subir Plan
            </Button>
          </Box>

          <Divider sx={{ my: 2 }} />

          <Grid container spacing={2}>
            {planes.map((plan, index) => (
              <Grid item xs={12} sm={4} key={index}>
                <Card
                  sx={{
                    border: plan.nombre === planActual ? '2px solid #1976d2' : 'none',
                    boxShadow: 3,
                  }}
                >
                  <CardContent>
                    <Typography variant="h6" color="primary" gutterBottom>
                      {plan.nombre}
                    </Typography>
                    <Chip label="Mensual" color="info" size="small" sx={{ mb: 1 }} />
                    <Typography variant="body2" color="text.secondary">
                      Límite de usuarios: {plan.limite_usuarios}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Lockers incluidos: {plan.lockers}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Costo: ${parseFloat(plan.costo).toFixed(2)}/mes
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Paper>
      </Box>
    </Box>
  );
};

export default AdministrarSuscripciones;
